import styled from 'styled-components';
import Card from '../Card';

const Container = styled.div`
    width: 55rem;
`;

function CardList(cardlist) {
    const Cards = cardlist ? cardlist.map(bg => 
        (<Card
            key={bg.id} 
            title={bg.title} 
            url={`/detail/${bg.id}`} 
            src={bg.cover}/>
        )
    ) : [];
    return (<Container>
        <Cards />
        <Card />
        <Card />
        <Card />
        <Card />
        <Card />
    </Container>)
}

export default CardList;
